add_ten:
def add_ten(x: float) -> float:
    """Add 10 to the input."""
    return x + 10.0

test_add_ten_basic:
def test_add_ten_basic():
    """Test with wrong assertions."""
    assert add_ten(5.0) == 16.0

test_add_ten_negative:
def test_add_ten_negative():
    """Test that will fail on reference."""
    assert add_ten(-3.0) == 8.0
